sourcesContent:
import styled from "styled-components"

export const Container = styled.div`
 text-align: center;
 color: blue;
 font-size:50px;
 width:500px;
 height: 500px;
 box-shadow: 3px 9px 30px rgb(10, 10, 10);
 background:#f1f1f1;
 border-radius: 9px;
`;
